import React, { Component } from 'react'
import Logo from './logo/Logo'
import RegOneMid from './RegOneMid'

class RegOne extends Component {

    render() {
        return (
            <div className="wrapper">
                <Logo />
                <RegOneMid history={this.props.history} />
            </div>
        )
    }
}
export default RegOne
